  false,\n\t\"url\": null,\n\t\"notes\": \"This grassland management plan for Wertheim
  National Wildlife Refuge is presented as an interim document to provide refuge staff
  in 1989 with management guidelines for managing grassland and old fields in the
  absence of formal refuge objectives and sufficient biological data which is needed
  for a non-interim plan. The objective of maintaining and enhancing refuge grassland/fields
  is 1) to provide representative habitat in early successional stages to benefit
  grassland wildlife species and 2) to provide a diversity of cover types and associated
  ecotones for the benefit of \"edge\" species and multi-cover type users. Of particular
  concern is the availability of suitable upland waterfowl nesting habitat for multi-cover
  type users such as mallard, black duck and gadwall that nest on the refuge.\",\n\t\"license_title\":
